import React from "react";
import style from "../styles/style.module.css";
import { Link } from "react-router-dom";

const PaginaInicial = () => {
  return (
    <div className={style.fondo}>
      <Link to={"/home"}>
        <h1 className={style.titulo}>Paises</h1>
      </Link>
    </div>
  );
};

export default PaginaInicial;
